import Navbar from './Navbar'
import { Button, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core';

const createStyles = makeStyles();

const Landing = () => {
  const classes = createStyles({
    button: {
      margin: '0 10px'
    }
  })

  return (
    <>
      <Navbar />
      <div className='welcome container'>
        <img src='/images/welcome.png' className='welcome-image' />
        <div>
          <Typography variant='h2' component='h1' gutterBottom>Welcome to Diary!</Typography>
          <Typography variant='h5' component='p' color='textSecondary' gutterBottom>Create your perosnal diary & notes</Typography>
        </div>
        <div className='buttons'>
          <Button variant='contained' className={classes.button}>Learn more</Button>
          <Button variant='contained' color='primary' className={classes.button}>Get started</Button>
        </div>
      </div>

    </>
  )
}

export default Landing
